import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Card, Button } from "react-bootstrap";
import { BodyStyled, TestStyled } from "./Body.styled";


function LargeCard() {
  return (
  
  <>
  <BodyStyled>
    <p>Automation Through Software Implimentation </p>
  
  <TestStyled>
    <p styled = 'font-size: 10px'>Eliminate.Automate.Delegate.</p>
  </TestStyled>
  </BodyStyled>  
  </>
)
}
export default LargeCard;
